table.properties:
position: absolute;
width: 1px;
height: 1px;
padding: 0;
margin: -1px;
overflow: hidden;
clip: rect(0, 0, 0, 0);
white-space: nowrap;
border-width: 0;

position: static;
width: auto;
height: auto;
padding: 0;
margin: 0;
overflow: visible;
clip: auto;
white-space: normal;

width: 100%;
@media (width >= 40rem) { max-width: 40rem; }
@media (width >= 48rem) { max-width: 48rem; }
@media (width >= 64rem) { max-width: 64rem; }
@media (width >= 80rem) { max-width: 80rem; }
@media (width >= 96rem) { max-width: 96rem; }

overflow: visible;
display: block;
-webkit-box-orient: horizontal;
-webkit-line-clamp: unset;

overflow: hidden;
text-overflow: ellipsis;
white-space: nowrap;

transition-property: color, background-color, border-color, text-decoration-color, fill, stroke, --tw-gradient-from, --tw-gradient-via, --tw-gradient-to, opacity, box-shadow, transform, translate, scale, rotate, filter, -webkit-backdrop-filter, backdrop-filter;
transition-timing-function: var(--default-transition-timing-function);
transition-duration: var(--default-transition-duration);

transition-property: color, background-color, border-color, text-decoration-color, fill, stroke, --tw-gradient-from, --tw-gradient-via, --tw-gradient-to;
transition-timing-function: var(--default-transition-timing-function);
transition-duration: var(--default-transition-duration);

transition-property: transform, translate, scale, rotate;
transition-timing-function: var(--default-transition-timing-function);
transition-duration: var(--default-transition-duration);

animation: var(--animate-spin);

@keyframes spin {
  to {
    transform: rotate(360deg);
  }
}

animation: var(--animate-ping);

@keyframes ping {
  75%, 100% {
    transform: scale(2);
    opacity: 0;
  }
}

animation: var(--animate-bounce);

@keyframes bounce {
  0%, 100% {
    transform: translateY(-25%);
    animation-timing-function: cubic-bezier(0.8, 0, 1, 1);
  }
  50% {
    transform: none;
    animation-timing-function: cubic-bezier(0, 0, 0.2, 1);
  }
}
